import React, { Component } from 'react';

export default class Pig extends Component {
  selectedPig = '';
  examinePig = e => {
    this.selectedPig = e.target.id;
    alert('test');
  };

  render() {
    return <div className="pig" onClick={this.examinePig} />;
  }
}
